import React from 'react';
import './EventCard.css'; // Assuming you have a separate CSS file for EventCard

const EventCard = ({ event }) => {
    return (
        <div className="event-card">
            <img src={event.image} alt={event.title} />
            <h3>{event.title}</h3>
            <p>Date: {event.date}</p>
            <p>Time: {event.time}</p>
            <p>Venue: {event.venue}</p>
            <p>Price: {event.cost}</p> {/* Make sure this line is present */}
            <p>{event.description}</p>
        </div>
    );
};

export default EventCard;
